;; **
;;; # Algebolic - evolving mathematical expressions
;;; 
;;; Algebolic is a library for evolving mathematical expressions. You can use it to perform what's known as symbolic regression, where a symbolic mathematical expression is found that fits a given dataset. More generally, you can use it to evolve mathematical expressions that optimise any score function. The expressions are implemented so they can be very quickly evaluated, as can their derivatives which is useful in more advanced applications. We use it in our research lab, for example, to evolve laws of physics directly from data.
;;; 
;;; Let's dive in and use algebolic to evolve an expression that fits (in the @@\chi^2@@ sense) some data. This worksheet will demonstrate basic usage with a canned function that provides sensible defaults; there are other worksheets that show more advanced configuration.
;; **

;; @@
(ns algebolic.demo.intro
  (:require [gorilla-plot.core :as plot]
            [gorilla-repl.table :as table]
            [darwin.evolution.pareto :as pareto]
            [algebolic.core :as algebolic]
            [algebolic.expression.interpreter :as interpreter]
            [algebolic.expression.render :as render]
            [algebolic.expression.tree :as tree]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; Let's make up some data to fit. Data is passed as a vector of coordinate vectors, which in this case will be one dimensional, and a list of target values.
;; **

;; @@
(def xs (range 0.0 30.0 1.0))
(def coords (mapv (fn [x] [x]) xs))
(def data (map (fn [x] (+ (* 2 x x) (* -0.07 x x x))) xs))
