;; **
;;; The function `algebolic/sr` can be used for straightforward symbolic regression. More complex configuration can be specified, but this one makes some sensible default choices. We will evolve a expression that is a function of a single variable `'x` using only the functions +, - and @@\times@@.
;; **

;; @@
(time
  (def result
    (algebolic/sr coords data '[x] #{:plus :minus :times} 1500)))
