;; **
;;; We can look at how well the best expression found thus far fits the data. The `interpreter/evaluate` function takes an algebolic expression and calculates its values (quickly!).
;; **

;; @@
(defn plot-exp
  [exp size]
  (plot/compose
    (plot/list-plot data :plot-range [:all :all] :plot-size size)
    (plot/list-plot (interpreter/evaluate exp '[x] coords) :joined true)))

(plot-exp (:genotype (nth (sort-by :complexity < (:elite result)) 49)) 400)
