;; **
;;; This doesn't tell the full story, though. Algebolic's `sr` function performs a multi-objective optimisation where it tries to simultaneously reduce the fit error and find a simple mathematical expression. It does not make any judgment in advance about how simple the expression should be, rather it maintains a set of representatives on the error-complexity trade-off curve. We can look at this set of expressions in so-called "objective space", that is, we'll plot the expression's error on the y-axis and its complexity on the x-axis.
;; **

;; @@
(defn pareto-plot-elite
  [[k1 k2] result]
  (let [pareto-front (pareto/non-dominated-individuals [k1 k2] (:elite result))
        coord-extract (fn [i] [(k1 i) (k2 i)])]
      (plot/list-plot (map coord-extract pareto-front) :colour "#ff29d2")))
