;; **
;;; We see that as the complexity increases, the best error goes down, as might be expected. It is interesting to look at the expressions generated at different levels of complexity/error. Usually we are interested in the simplest expression that has an error below some threshold.
;; **

;; @@
(defn get-nth-elite [n] (:genotype (nth (sort-by :complexity < (:elite result)) n)))

(defn table-row [n] ((juxt identity
                           tree/count-nodes
                           render/mathematician-view
                           #(plot-exp % 200)) (get-nth-elite n)))

(table/table-view (mapv table-row [19 29 41 44 46]) :columns ["Genotype" "Complexity" "Expression" "Plot"])
